import{_ as a}from"./chunks/v5_nano_01.BFDPyset.js";import{_ as e,a as l,b as r,c as s,d as t,e as o,f as i}from"./chunks/v5_nano_pinouts.BxCkNroR.js";import{_ as n,c,o as d,ab as p}from"./chunks/framework.CUflZczI.js";const y=JSON.parse('{"title":"Швидке підключення CUAV V5 nano","description":"","frontmatter":{},"headers":[],"relativePath":"uk/assembly/quick_start_cuav_v5_nano.md","filePath":"uk/assembly/quick_start_cuav_v5_nano.md"}'),h={name:"uk/assembly/quick_start_cuav_v5_nano.md"},m=p('<h1 id="швидке-підключення-cuav-v5-nano" tabindex="-1">Швидке підключення CUAV V5 nano <a class="header-anchor" href="#швидке-підключення-cuav-v5-nano" aria-label="Permalink to &quot;Швидке підключення CUAV V5 nano&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (або будь-який інший) автопілот. Звертайтесь до <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">виробника</a> щодо питань апаратного забезпечення або питань відповідності.</p></div><p>Цей швидка інструкція показує, як живити польовий контролер <a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a> та під&#39;єднати його найважливіші периферійні пристрої.</p><p><img src="'+a+'" alt="Nano Hero Image"></p><h2 id="огляд-схеми-підключення" tabindex="-1">Огляд схеми підключення <a class="header-anchor" href="#огляд-схеми-підключення" aria-label="Permalink to &quot;Огляд схеми підключення&quot;">​</a></h2><p>На зображенні нижче показано, як під&#39;єднати найважливіші датчики та периферійні пристрої (за винятком виходів мотора та сервоприводів). Ми розглянемо кожну з них докладно в наступних розділах.</p><p><img src="'+e+'" alt="quickstart"></p><table><thead><tr><th style="text-align:left;">Основний інтерфейс</th><th style="text-align:left;">Функція</th></tr></thead><tbody><tr><td style="text-align:left;">Живлення</td><td style="text-align:left;">Під&#39;єднати модуль живлення; Надає живлення та виміри напруги та струму ANALOG.</td></tr><tr><td style="text-align:left;">PM2</td><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_nano.html#compatibility_pm2">Не використовуйте з PX4</a></td></tr><tr><td style="text-align:left;">TF CARD</td><td style="text-align:left;">Карта SD для зберігання logs (постачається з картою)</td></tr><tr><td style="text-align:left;">M1~M8</td><td style="text-align:left;">PWM виходи. Може бути використаний для управління двигунами або сервоприводами.</td></tr><tr><td style="text-align:left;">A1~A3</td><td style="text-align:left;">Capture pins (not <em>currently</em> supported on PX4).</td></tr><tr><td style="text-align:left;">nARMED</td><td style="text-align:left;">Вказує на стан зброєння FMU. Це активне низьке (низьке під час увімкнення).</td></tr><tr><td style="text-align:left;">DSU7</td><td style="text-align:left;">Використовується для дебагінгу FMU, читання інформації щодо дебагінгу.</td></tr><tr><td style="text-align:left;">I2C2/I2C3/I2C4</td><td style="text-align:left;">Підключає пристрій I2C, такий як зовнішній компас.</td></tr><tr><td style="text-align:left;">CAN1/CAN2</td><td style="text-align:left;">Підключає пристрої UAVCAN, такі як CAN GPS.</td></tr><tr><td style="text-align:left;">TYPE-C(USB)</td><td style="text-align:left;">Під&#39;єднатися до комп&#39;ютера для зв&#39;язку між контролером польоту та комп&#39;ютером, наприклад, як завантаження прошивки</td></tr><tr><td style="text-align:left;">GPS&amp;SAFETY</td><td style="text-align:left;">Приєднайтесь до Neo GPS, який містить GPS, перемикач безпеки, інтерфейс зумовлювача.</td></tr><tr><td style="text-align:left;">TELEM1/TELEM2</td><td style="text-align:left;">Під&#39;єднатися до системи телеметрії.</td></tr><tr><td style="text-align:left;">DSM/SBUS/RSSI</td><td style="text-align:left;">Включає інтерфейси введення сигналів DSM, SBUS, RSSI, інтерфейс DSM може бути підключений до приймача DSM-супутника, інтерфейс SBUS - до приймача дистанційного керування SBUS, RSSI - для модуля зворотного повернення сили сигналу.</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">Для отримання додаткової інформації про інтерфейс, будь ласка, прочитайте <a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">Посібник з V5 nano</a>.</p></div><p><img src="'+l+'" alt="quickstart"></p><div class="info custom-block"><p class="custom-block-title">Якщо контролер не може бути змонтований в рекомендованій/стандартній орієнтації (наприклад, через обмеження місця), вам потрібно буде налаштувати програмне забезпечення автопілота з орієнтацією, яку ви фактично використовували: <a href="./../gps_compass/rtk_gps.html">Орієнтація контролера польоту</a>.</p></div><h2 id="gps-компас-безпечнии-вимикач-світлодіоди" tabindex="-1">GPS + Компас + Безпечний вимикач + Світлодіоди <a class="header-anchor" href="#gps-компас-безпечнии-вимикач-світлодіоди" aria-label="Permalink to &quot;GPS + Компас + Безпечний вимикач + Світлодіоди&quot;">​</a></h2><p>Рекомендованим модулем GPS є <em>Neo v2 GPS</em>, який містить GPS, компас, запобіжний вимикач, зумер, світлодіодний індикатор статусу.</p><div class="info custom-block"><p class="custom-block-title">Інші модулі GPS можуть не працювати (див. <a href="./../flight_controller/cuav_v5_nano.html#compatibility_gps">цю проблему сумісності</a>)).</p></div><p>Модуль GPS/Компас слід <a href="./../assembly/mount_gps_compass.html">монтувати на раму</a> якомога подалі від інших електронних пристроїв, з напрямком вперед транспортного засобу (стрілка Neo GPS спрямована в тому ж напрямку, що й стрілка керування польотом). Під&#39;єднайтеся до інтерфейсу GPS контролера польоту за допомогою кабелю.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Якщо ви використовуєте CAN GPS, будь ласка, використовуйте кабель для підключення до інтерфейсу CAN контролера польоту.</p></div><p><img src="'+r+'" alt="quickstart"></p><h2 id="запобіжнии-перемикач" tabindex="-1">Запобіжний перемикач <a class="header-anchor" href="#запобіжнии-перемикач" aria-label="Permalink to &quot;Запобіжний перемикач&quot;">​</a></h2><p>Спеціальний запобіжний вимикач, який поставляється з V5+, потрібен лише у випадку, якщо ви не використовуєте рекомендований <em>GPS Neo V2</em> (у якому вбудований запобіжний вимикач).</p><p>Якщо ви літаєте без GPS, ви повинні прикріпити вимикач безпосередньо до порту <code>GPS1</code>, щоб мати можливість озброїти рухомий засіб і летіти (якщо ви використовуєте старий GPS з 6 контактами, будь ласка, прочитайте визначення нижнього інтерфейсу для зміни лінії).</p><h2 id="зумер" tabindex="-1">Зумер <a class="header-anchor" href="#зумер" aria-label="Permalink to &quot;Зумер&quot;">​</a></h2><p>Якщо ви не використовуєте рекомендований <em>Neo v2 GPS</em>, зумер може не працювати.</p><h2 id="радіоуправління" tabindex="-1">Радіоуправління <a class="header-anchor" href="#радіоуправління" aria-label="Permalink to &quot;Радіоуправління&quot;">​</a></h2><p>Для ручного керування вашим апаратом потрібна система дистанційного керування радіо (RC) (PX4 не вимагає наявності системи радіо для автономних режимів польоту). Вам буде потрібно вибрати сумісний передавач/приймач та потім зв&#39;язати їх, щоб вони взаємодіяли (прочитайте інструкції, що додаються до вашого конкретного передавача/приймача).</p><p>На малюнку нижче показано, як ви можете отримати доступ до вашого віддаленого приймача (знайдіть кабель S.Bus у комплекті)</p><p><img src="'+s+'" alt="quickstart"></p><h2 id="супутникові-приимачі-spektrum" tabindex="-1">Супутникові приймачі Spektrum <a class="header-anchor" href="#супутникові-приимачі-spektrum" aria-label="Permalink to &quot;Супутникові приймачі Spektrum&quot;">​</a></h2><p>V5 nano має присвячений кабель DSM. Якщо використовується супутниковий приймач Spektrum, його слід підключити до інтерфейсу <code>DSM/SBUS/RSSI</code> контролера польоту.</p><h2 id="потужність" tabindex="-1">Потужність <a class="header-anchor" href="#потужність" aria-label="Permalink to &quot;Потужність&quot;">​</a></h2><p>Набір <em>v5 nano</em> включає модуль <em>HV_PM</em>, який підтримує LiPo-акумулятори від 2 до 14S. Підключіть 6-контактний роз&#39;єм модуля <em>HW_PM</em> до інтерфейсу живлення керування польотом <code>Power</code>.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Наданий модуль живлення не захищений від перегріву. Живлення <strong>повинне</strong> бути вимкнене при підключенні периферійних пристроїв.</p></div><p><img src="'+t+'" alt="quickstart"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Модуль живлення не є джерелом живлення для периферійних пристроїв, підключених до виходів PWM. Якщо ви підключаєте сервоприводи / приводи, вам потрібно окремо живити їх за допомогою BEC.</p></div><h2 id="система-телеметріі-опціонально" tabindex="-1">Система телеметрії (Опціонально) <a class="header-anchor" href="#система-телеметріі-опціонально" aria-label="Permalink to &quot;Система телеметрії (Опціонально)&quot;">​</a></h2><p>Система телеметрії дозволяє вам спілкуватися, контролювати та управляти транспортним засобом у польоті з наземної станції (наприклад, ви можете направляти БПЛА до певної позиції або завантажувати нове завдання).</p><p>Канал зв&#39;язку здійснюється через телеметричні радіостанції. Радіостанцію, розташовану на транспортному засобі, слід підключити до порту <strong>TELEM1</strong> або <strong>TELEM2</strong> (якщо підключено до цих портів, додаткова конфігурація не потрібна). Інша радіостанція підключається до вашого комп&#39;ютера або мобільного пристрою наземної станції (зазвичай через USB).</p><p><img src="'+o+'" alt="quickstart"></p><p><a id="sd_card"></a></p><h2 id="sd-карта-опціонально" tabindex="-1">SD-карта (Опціонально) <a class="header-anchor" href="#sd-карта-опціонально" aria-label="Permalink to &quot;SD-карта (Опціонально)&quot;">​</a></h2><p><a href="./../getting_started/px4_basic_concepts.html#sd-cards-removable-memory">SD-картку</a> вставляють на заводі (вам нічого не потрібно робити).</p><h2 id="двигуни" tabindex="-1">Двигуни <a class="header-anchor" href="#двигуни" aria-label="Permalink to &quot;Двигуни&quot;">​</a></h2><p>Мотори/сервоприводи підключені до портів MAIN в порядку, вказаному для вашого апарату в <a href="./../airframes/airframe_reference.html">Довіднику планерів</a>.</p><p><img src="'+t+'" alt="quickstart"></p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p><img src="'+i+'" alt="V5 nano pinouts"></p><h2 id="детальна-інформація" tabindex="-1">Детальна інформація <a class="header-anchor" href="#детальна-інформація" aria-label="Permalink to &quot;Детальна інформація&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">Журнал збірки конструкції повітряного каркасу за допомогою CUAV v5 nano на рамі DJI FlameWheel450</a></li><li><a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano </a></li><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">Посібник з V5 Nano</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">Схема роз&#39;ємів для посилання на FMUv5</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li></ul>',47),_=[m];function u(f,g,S,b,k,P){return d(),c("div",null,_)}const A=n(h,[["render",u]]);export{y as __pageData,A as default};
